import io
import fastavro
import json
from typing import List
from dataclasses import dataclass

@dataclass
class BLEPacket:
    timestamp: float
    rssi: int
    channel_index: int
    advertising_address: int
    company_id: int
    packet_counter: int
    protocol_version: int
    power_level: int
    oui: str
    long_device_name: str
    short_device_name: str
    uuids: str

@dataclass
class PacketDelivery:
    serial_id: int
    timestamp: int
    packets: List[BLEPacket]

def decode_avro_packet(binary_data: bytes) -> PacketDelivery:
    try:
        with open('../config/packet_schema.avsc', 'r') as packet_schema_file:
            packet_schema = json.load(packet_schema_file)
        
        print(f"Received data length: {len(binary_data)}")
        print(f"First 20 bytes: {binary_data[:20]}")
        
        bytes_reader = io.BytesIO(binary_data)
        reader = fastavro.reader(bytes_reader, packet_schema)
        data = next(reader)
        
        # data -> dataclass struct
        packets = [
            BLEPacket(
                timestamp=p['timestamp'],
                rssi=p['rssi'],
                channel_index=p['channel_index'],
                advertising_address=p['advertising_address'],
                company_id=p['company_id'],
                packet_counter=p['packet_counter'],
                protocol_version=p['protocol_version'],
                power_level=p['power_level'],
                oui=p['oui'],
                long_device_name=p['long_device_name'],
                short_device_name=p['short_device_name'],
                uuids=p['uuids']
            )
            for p in data['packets']
        ]
        
        return PacketDelivery(
            serial_id=data['serial_id'],
            timestamp=data['timestamp'],
            packets=packets
        )
    except Exception as e:
        print("\nDebug info:")
        if len(binary_data) >= 4:
            print(f"First 4 bytes as int: {int.from_bytes(binary_data[:4], 'big')}")
        if len(binary_data) >= 8:
            print(f"First 8 bytes as int: {int.from_bytes(binary_data[:8], 'big')}")
        raise ValueError(f"Failed to decode Avro data: {str(e)}")

